export const Presentational=({rows, setRows})=>{
    return(
        <div>
            <h2>LISTADO DE LIBROS</h2>
            <table>
                <thead>
                    <tr>
                        {/* <th></th> */}
                        <th>Título</th>
                        <th>Autor</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    {rows.map((item, i) => {
                        return [
                            <tr key={i} 
                            // onClick={toggleMobileOpen.bind(this, i)}>
                            >
                            {/* <td className="toggler">
                                {item.mobile_open && <ArrowUp />}
                                {!item.mobile_open && <ArrowDown />}
                            </td> */}
                            <td>{item.titulo}</td>
                            <td>{item.autor}</td>
                            <td><button disabled={!item.disponible}>Solicitar Préstamo</button></td>
                            </tr>,

                            // //This inline conditional makes it weird but this works
                            // ...[item.mobile_open &&
                            // <tr className="test-td">
                            //     <td>...</td>
                            // </tr>
                            // ]
                        ];
                    })}
                </tbody>
            </table>
        </div>
    )
}
